<div class="entities" style="line-height: 2.5; direction: ltr">Bypassing tumor-specific and bispecific antibodies : triggering of antitumor immunity by expression of anti-FcgammaR scFv on cancer cell surface . We have developed a novel immunostimulatory molecule against tumor cells , composed of an anti-FcgammaRIII ( CD16 ) scFv fused to the platelet-derived growth factor receptor (

 / IL - 12 cytokine circuit by interferon-beta inhibits the development of epitope spreading and disease progression in murine autoimmune encephalomyelitis . IFN-beta has been shown to be effective in the treatment of multiple sclerosis ( MS ) . However , the primary mechanism by which IFN-beta mediates its therapeutic effect remains unclear . Recent studies indicate that under defined conditions , IFN-beta may downregulate DC expression of IL - 12 . We and others have shown that IFN-beta may also downregulate

 gene was expressed in a number of corticotroph tumors and in the DB01285 - secreting ectopic tumor , and that the V3R gene appears to be overexpressed in these tumors . We conclude that V3R mutations are unlikely to be present in the DB01285 - secreting tumors we examined , but that the

 gene is expressed in the majority of the samples tested , and the V3R is expressed in all of these tumors . We speculate that the response to the desmopressin test observed in patients with Cushing ' s disease may be due to abnormal expression of V3R or

 not only inhibits osteoclasts but also has been reported to positively affect osteoblasts . This study assesses the knockdown effects of siRNA targeting FPPS compared with alendronate in both osteoclast and osteoblast cultures . Primary murine bone marrow cell-induced osteoclasts and the preosteoblast MC3T3 - E1 cell line were used to assess effects of anti-FPPS siRNA compared with alendronate . Results show that both FPPS mRNA message and protein knockdown in serum-based culture is correlated with reduced osteoclast viability . FPPS siRNA is more potent than 10 μM alendronate , but less potent than 50 μM alendronate on reducing osteoclast viability . Despite FPPS knockdown , no significant changes were observed in osteoblast proliferation . FPPS knockdown promotes osteoblast differentiation significantly but not cell mineral deposition . However , compared with 50 μM alendronate dosing , FPPS siRNA does not exhibit cytotoxic effects on osteoblasts while producing significant effects on ostoblast differentiation . Both siRNA and alendronate at tested concentrations do not have significant effects on cultured osteoblast mineralization . Overall , results indicate that siRNA against FPPS could be useful for selectively inhibiting osteoclast-mediated bone resorption and improving bone mass maintenance by influencing both osteoclasts and osteoblasts in distinct ways .</div>

 , IL - 12 and

<div class="entities" style="line-height: 2.5; direction: ltr">Fluorescence energy transfer analysis of calmodulin-peptide complexes . The interactions between calmodulin and the tryptophan residues of synthetic peptides corresponding to the calmodulin binding domains of skeletal muscle myosin light-chain kinase and the plasma membrane calcium pump were examined . The single tryptophan residue contained in each peptide became relatively immobilized and inaccessible to iodide ion upon binding to calmodulin , indicating that the indole side chain was inserted into a hydrophobic cleft in the surface of calmodulin . Fluorescence energy transfer from peptidyl tryptophan residues to an AEDANS moiety attached to cysteine - 26 of spinach calmodulin was measured . Included in these analyses was a tryptophan-containing peptide analog of the calmodulin binding domain of neuromodulin . These data indicated that the indole ring of each peptide inserted 32-35 A away from cysteine - 26 and may therefore interact with the carboxyl-terminal lobe of P62158 in its &quot; bent &quot; conformation [ Persechini &amp; Kretsinger ( 1988a ) J . Cardiovasc . Pharmacol . 12 ( Suppl 5 ) , S1 -

 ; Ikura et al . ( 1992 ) Science 256 , 632-638 ; Vorherr et al . ( 1992 ) Eur . J . Biochem . 204 , 931-937 ] . The interchange of tryptophan - 3 and phenylalanine - 21 of the calcium pump peptide increased the efficiency of energy transfer to the AEDANS-moiety approximately 12 - fold , reducing the calculated distance to 20 A . These data suggest that phenylalanine - 21 of the calcium pump peptide interacts with the hydrophobic cleft in the amino-terminal lobe of P62158 .</div>

<h2 style="margin: 0">31</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Immunomodulatory role of high-density lipoproteins : impact on immunosenescence . Natural aging is accompanied by a dysregulation of the host immune response that has well-known clinical consequences but poorly defined underlying causes . It has previously been reported that advancing age is associated with an increase in membrane cholesterol level in T cells . The aim of this study was to investigate whether high-density lipoprotein ( HDL ) can modulate the age-related accumulation of membrane cholesterol in T cells and impact on their subsequent responsiveness . Our data reveal that cholesterol metabolism , influx , and efflux are altered in T cells with aging , which may in part explain the increase in membrane cholesterol level observed in T cells in elderly individuals . HDL was unable to promote reverse cholesterol transport in T cells from elderly subjects with the same efficiency as was observed in T cells from young subjects besides unchanged ABCA - 1 and Q8WTV0 expressions . HDL exhibited a short-acting co-stimulatory effect by enhancing T cell production of interleukin - 2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P60568
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . Moreover , HDL from healthy normolipemic individuals exerted differential effects on T cell proliferation that depended on the age of the HDL donor . Finally , HDL modulated TCR / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10747
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 activation by inducing sustained signaling through pLck , pERK , and pAkt . These data suggest that HDL has immunomodulatory effects on T cells that are influenced by age .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Heart allograft protection with low-dose carbon monoxide inhalation : effects on inflammatory mediators and alloreactive T-cell responses . BACKGROUND : DB11588 ( CO ) , a byproduct of heme catalysis , has lately received considerable attention as a regulatory molecule in cellular and biological processes . CO has been shown to provide potent protection against a variety of tissue injuries . We hypothesized in this study that low concentration CO would be beneficial for organ allografts , which frequently undergo several types of injury such as ischemia / reperfusion , alloimmune reaction , and inflammation METHODS : The efficacy of low-dose CO was examined in a fully allogeneic LEW to BN rat heterotopic heart transplantation ( HHTx ) model . Recipients were kept in air or exposed to low-dose CO ( 20 ppm ) for 14 , 28 , or 100 days after HHTx under short-course tacrolimus RESULTS : CO treatment ( d0 - 28 , 0-100 ) was remarkably effective in prolonging heart allograft survival to a median of &gt; 100 from 45 days in the air-control group , with significant reductions of arteritis , fibrosis , and cellular infiltration , including macrophages and T cells . CO inhibited intragraft upregulation of Th1 type cytokines (

 , IFNgamma ) , proinflammatory mediators ( IL - 1beta , TNFalpha ,

 ,

<div class="entities" style="line-height: 2.5; direction: ltr">In vitro cell death of activated lymphocytes in Omenn ' s syndrome . Omenn ' s syndrome ( OS ) is characterized by erythrodermia , hepatosplenomegaly , lymphadenopathy , hypereosinophilia and elevated IgE levels associated with increased susceptibility to severe infections . Peripheral blood T cells , though usually present in normal number , show an activated phenotype ( including an increased expression of CD95 / Fas ) , a Th2 pattern of cytokine secretion and defective proliferative response to mitogens . In this report , we demonstrate that T cells from patients with OS undergo an excessive cell death in vitro resulting from two mechanisms . First , a substantial number of peripheral blood lymphocytes from OS patients die in unstimulated cultures ( p = 0.009 vs . healthy controls ) . This spontaneous apoptosis is associated with reduced expression of bcl - 2 gene product ( p &lt; 0.05 ) and can be prevented by addition of interleukin ( IL ) - 2 ( which also prevents down-modulation of bcl - 2 ) , while is independent from CD95 signaling . Second , lymphocytes from OS patients are highly susceptible to activation-induced cell death ( AICD ) induced with mitogens . This mechanism is largely independent from 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , while it can be significantly inhibited blocking CD95 with an IgG 2b monoclonal antibody ( mAb ) . The dependence of AICD from signals transduced via CD95 was confirmed showing that cross-linking CD95 with an IgM mAb induces a higher cell death in purified 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
